import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import MySlider from './Components/Slider/Slider';
import Navtabs from './Components/Navtabs/Navtabs';
import Rating from './Components/Rating/Rating';
import MyTeam from './Components/Team/Team';
import RegForm from './Components/RegForm/RegForm';
import LoginForm from './Components/LoginForm/LoginForm';
import Footer from './Components/Footer/Footer';
import Header from './Components/Header/Header';


function Home() {
  return (
    <div>
      <MySlider />
      <Footer />
    </div>
  );
}

function Pricing() {
  return (
    <div>
      <Footer />
  </div>
  );
}

function Feedback() {
  return (
    <div>
      <Navtabs />
      <Rating />
      <Footer />
    </div>
  );
}

function Team() {
  return (
    <div>
      <MyTeam />
      <Footer />
    </div>
  );
}

function Signin() {
  return (
    <div>
      <LoginForm />
      <Footer />
    </div>
  );
}
function Signup() {
  return (
    <div>
      <RegForm />
      <Footer />
    </div>
  );
}


export default function App() {
  return (
    <>
    <Router>
      <div>        
        <Header/>
        <Switch>
          <Route exact path="/start-it-front" component={Home}/>
          <Route path="/start-it-front/join" component={Signup}/>           
          <Route path="/start-it-front/login" component={Signin}/>            
          <Route path="/start-it-front/feedback" component={Feedback}/>            
          <Route path="/start-it-front/team" component={Team}/>
          <Route path="/start-it-front/pricing" component={Pricing}/>          
        </Switch>
      </div>
    </Router>
    </>
  );
}
